import React from 'react';
import './App.css';
import {Query} from 'react-apollo';

const GET_CURRENT_USER = gql`
  {
    viewer {
      login
      name
    }
  }
`;

function App() {
  return (
    <div className="App">
      <Query query={GET_CURRENT_USER}>
        {() => <div>This is test</div>}
      </Query>
    </div>
  );
}

export default App;
